webpackJsonp([0x9b0addfd69d1],{1741:function(a,e){a.exports={data:{markdownRemark:{html:'<p>해외에서의 "중국 위협 이론"에 대한 리뷰 기사를보십시오. 중국의 경제 발전 이후,이 역설은 점차 증가하여 특정 시장에 대한 이론이되었습니다. 요점은 중국의 미래가 가장 포괄적 인 경제적 힘을 지닌 세계에서 가장 강력한 국가 일 수 있으며 따라서 주변 국가에 위협이 될 수 있다는 것이다. 중국이 군사력을 개발 중이다. 이것은 일종의 이상한 발언입니다. 중국의 경제는 발전하지 않았으며, 주변에는 많은 의심스러운 소음이있었습니다. 경제가 발전하고 무서워졌습니다. 중국 주변에는 여전히 중국보다 강력한 국가들이 있지만 "위협"은 아닙니다. 일본의 군사비 지출은 세계에서 2 번째이지만 "위협"은 아니다. 이런 종류의 여론은 일본 시장에 있습니다.</p>\n<p>이런 종류의 "중국 위협 이론"은 무시할 수 있습니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0188.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0188.md",frontmatter:{title:"11월 17일 목요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0188.md absPath of file >>> MarkdownRemark"}}}});
